Errol Morris burst out of the gate with this brilliant debut feature,
about two pet cemeteries in Northern California and the people
involved with them.
Such a description, however, can hardly do justice to the
captivating, funny, and enigmatic Gates of Heaven, a film that is
about our relationships to our pets, each other, and ourselves.
Both sincere and satirical, this is an endlessly surprising study of
human nature.

